import AppLayout from '../components/AppLayout';
import Navbar from '../components/Navbar/Navbar';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
const Home = () => {

    return(
        <AppLayout>
            <Router>
                <Switch>
                    <Navbar />
                </Switch>
            </Router>    
            <div>Hello</div>
        </AppLayout>
    );
}

export default Home;
